using namespace std;

int toInt (string s) {
  int num = 0;
  reverse(s.begin(), s.end());
  int pw = 1;
  for(string::iterator it = s.begin();
      it != s.end();
      it++) {
    num += pw * (int(*it)-48);
    pw *= 10;
  }
  return num;
}

bool isNumber (string s) {
  for(string::iterator it = s.begin();
      it != s.end();
      it++) {
    if (!(*it >= '0' && *it <= '9'))
      return false;
  }
  return true;
}

